Failing to perform announcement loop means the validator doesn't know the instance ever went hot, so it will be deleted eventually by the validator.  Your gepetto should have reconciled that the instance doesn't exist in the validator and removed the chute so it could schedule another one.  Its the first thing the reconcile loop does, which runs every 10 minutes, so that bad chute shouldn't be deployed for long.
